<script>
import axios from "axios";

export default {
  name: 'Map',
  head: {
    title: 'IOTparking - Mapa',
  },
  mounted() {
    this.$root.$on('reserve', (reservationInfo) => this.afterReserve(reservationInfo));

    let svg = document.getElementById('svg18093');
    let cars = svg.querySelectorAll('.car')
    cars.forEach(car => {
      let idStr = car.getAttribute('id')
      let id = Number(idStr.replace('car', ''))
      car.addEventListener('click', () => {
        cars.forEach(car => {
          car.removeAttribute('active')
        })
        //car.style.fill = '#ffffff'
        car.setAttribute('active','true')
        this.selectedCarId = id
        this.drawer = true
      })
    })

    this.updateContent()
  },
  data(){
    return {
      drawer: false,
      selectedCarId: -1,
      reservedSlots: new Map(),
    }
  },
  methods: {
    afterReserve(reserveInfo) {
      let oldId = this.selectedCarId;
      this.reservedSlots.set(oldId, reserveInfo);
      this.selectedCarId = -1;
      this.$nextTick(() => {
        this.selectedCarId = oldId;
      })
    },
    updateContent(){
      let svg = document.getElementById('svg18093');

      for (let i = 1; i <= 16; i++) {
        axios.get('http://localhost:3000/api/parkslot/' + i)
          .then(response => {
            let cData = response.data;
            let car = svg.querySelector('#car' + i)
            if (cData?.distance === 1) { // slot is occupied
              car.style.fill = '#d5555d'
              car.setAttribute('active','true')
            } else { // slot is free
              car.style.fill = '#379a17'
              car.removeAttribute('active')
            }
          })
      }

      for (let i = 1; i <= 16; i++) {
        axios.get('http://localhost:3000/api/temperature/' + i)
          .then(response => {
            let tData = response.data;
            axios.get('http://localhost:3000/api/humidity/' + i)
              .then(response1 => {
                let hData = response1.data;
                let warning = document.getElementById('alert' + i);
                if (hData?.humidity > 70 && tData?.temperature < 0) {
                  warning.style.display = 'flex';
                  warning.style.fill = 'blue';
                }
                else if (hData.humidity < 30 && tData?.temperature > 35) {
                  warning.style.display = 'flex';
                  warning.style.fill = 'red';
                }
                else {
                  warning.style.display = 'none';
                }
              })
          })
      }
    }
  }
}
</script>

